import React, { Component } from 'react'
import './App.css';
import Navigation from './components/Navigation/Navigation';
import Logo from './components/Logo/Logo';
import ImageLinkForm from './components/ImageLinkForm/ImageLinkForm';
import Rank from './components/Rank/Rank';
import Particles from "react-tsparticles";
import ParticleOptions from './components/ParticleOptions/ParticleOptions'


// const app = new Clarifai.App({
//   apikey: 'efcab308da914eebbebf79df9f33211f'
// });

class App extends Component {
  constructor() {
    super();
    this.state = {
      input: '',
    }
  }

  onInputChange = (event) => {
    console.log(event.target.value);
  }

  onButtonSubmit = () => {
    console.log('click');
    const request = new service.PostModelOutputsRequest();
      request.setModelId("efcab308da914eebbebf79df9f33211f");
      request.addInputs(
          new resources.Input()
              .setData(
                  new resources.Data()
                      .setImage(
                          new resources.Image()
                              .setUrl("https://samples.clarifai.com/dog2.jpeg")
                      )
              )
      )

      clarifai.postModelOutputs(
          request,
          metadata,
          (error, response) => {
              if (error) {
                  throw error;
              }

              if (response.getStatus().getCode() !== StatusCode.SUCCESS) {
                  throw "Error: " + response.getStatus();
              }

              console.log("Predicted concepts, with confidence values:")
              for (const concept of response.getOutputsList()[0].getData().getConceptsList()) {
                  console.log(concept.getName() + " " + concept.getValue());
              }
          }
      )
    };

    // app.models.predict("efcab308da914eebbebf79df9f33211f", "https://samples.clarifai.com/face-det.jpg").then(
    //   function(response) {
    //   },
    //   function(err) {
    //   }
    // )

  render() {
    return (
      <div className="App">
        <Particles 
          params={ParticleOptions}/>
        <Navigation />
        <Logo />
        <Rank />
        <ImageLinkForm 
          onInputChange={this.onInputChange} 
          onButtonSubmit={this.onButtonSubmit}
        />
        {/*

        <FaceRecognition />*/}
      </div>
    );
  }
}

export default App;
